import React from "react";
import Router from "../components/routing/Router";
import { Container } from 'react-bootstrap'

import Navbar from "../components/routing/Navbar";
const App = () => {
  return (
    <Container fluid>
      <Navbar />
      <Router />
    </Container>
  );
};

export default App;
